            </Link>
          );
        })} */}
      </div>
      {/* {
        data.map(x=>(
          <Link to="/product-name" ><Photobook img={photobookbg} /></Link>
        ))
      } */}
      <BottomNavbar />
    </div>
  );
}

export default Product;
